import React from 'react'

const NotFound = () => {
  return (
    <div style = {{textAlign: 'center'}}>
        <h1 style = {{textAlign: 'center', fontSize: 'max(3vw, 30px)', marginTop:'25px'}}>Page Not Found</h1>
        <a href = '/' style = {{textDecoration: 'underline', textAlign: 'center', fontSize: 'max(1.5vw, 15px)', marginTop:'25px'}}>Back to home</a>
    </div>
  )
}

export default NotFound
